import React,{Component} from 'react'
import {connect} from 'react-redux'
import {List, Image} from 'semantic-ui-react'

//const VideoList = props => {
class VideoList extends Component(video){
    renderVideo(){
        return(
            <List animated verticalAlign='middle'>
                <List.Item>
                    <Image avatar src={video.snippet.thumbnails.url}></Image>
                </List.Item>
                <List.Content>
                    <List.Header>{video.snippet.title}</List.Header>    
                </List.Content>   
            </List>
        )
    }

    render(){
        return(
            <div className="video-list">
                {
                    this.props.videos.map(video => { return this.renderVideo(video)})
                }
            </div>
        )
    }

}
const mapStateToProps = (state) => {
    return {
        videos: state.busca.videos,
        carregando: state.busca.carregando,
        erro: state.busca.erro
    }
}
export default connect(mapStateToProps, null)(VideoList)
